@Goldinco sent me this sick package for the trending King Of Collectibles: The Goldin Touch which is currently on @Netflix! The show follows @Kengoldin and his team from Goldin Auctions where the venture out to find hard to find collectors items! 

I myself binged all 6 episodes last night till 5AM and I throughly enjoyed every aspect of it! It was super interesting seeing the variety of collectibles the show had put on display. I highly recommend this show to everyone!

